import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
function Login() {
  return (
	<Container sx={{marginTop:"13%"}} maxWidth="sm">
        <Box component="span" sx={{border: '1px dashed grey', height:"100vh" }}>

			<Grid container spacing={2}>
				<Grid item xs={8}>
				xs=8
				</Grid>
				<Grid item xs={4}>
				xs=4
				</Grid>
				<Grid item xs={4}>
				xs=4
				</Grid>
				<Grid item xs={8}>
				xs=8
				</Grid>
			</Grid>
    	</Box>
      </Container>
  )
}

export default Login
